import React from "react";
import "./mainMenu.css";
import images from "../../img/image";
import { ServicesPage } from "../../Pages";
import { AiOutlineArrowLeft, AiOutlineArrowRight } from "react-icons/ai";

const imagelist = [images.Mainimage].map((image) => 
  <li className="aa">
    <I className="w-6 h-6" src={image} alt="/" />
  </li>
);
export default function MainMenu() {
  return (
    <main>
      <section className="image-slidebar">
        <AiOutlineArrowLeft className="arrow float-left" />
        <div className="slider">
          <ul>{imagelist}</ul>
        </div>
        <AiOutlineArrowRight className="arrow float-right" />
      </section>
    </main>
  );
}
